/* istanbul ignore file */
/* tslint:disable */
/* eslint-disable */
import type { UserBalance } from '../models/UserBalance';
import type { CancelablePromise } from '../core/CancelablePromise';
import { request as __request } from '../core/request';

export class UsersService {

    /**
     * User Balance
     * @returns UserBalance Successful Response
     * @throws ApiError
     */
    public static userBalanceUserBalanceGet(): CancelablePromise<UserBalance> {
        return __request({
            method: 'GET',
            path: `/user/balance`,
        });
    }

}
